// SPDX-License-Identifier: MIT

pragma solidity >=0.7.0 <0.8.0;

contract EscribirEnLaBlockchain{

    string texto;

    function Escribir(string calldata _texto) external {

        texto = _texto;

    }

    function Leer() external view returns(string memory) {

        return texto;

    }

}

